import React from 'react';
import NavCart from '../NavCart/NavCart';
import classes from './Header.module.css';
import meals from '../../../assests/meals.jpg'


const Header = (props) => {
  return (
  <>
   <header className={classes.head}>
     <h1></h1>
     <NavCart />
   </header>
 </>
  )
}

export default Header
